CREATE TABLE participant_demographics (
    participant_id INT PRIMARY KEY,
    age INT,
    gender VARCHAR,
    location VARCHAR
);

CREATE TABLE survey_location (
    location_id INT PRIMARY KEY,
    city VARCHAR,
    state VARCHAR
);

CREATE TABLE survey_participants (
  id SERIAL PRIMARY KEY,
  age INT,
  gender VARCHAR,
  location VARCHAR
);

CREATE TABLE survey_locations (
  location_id SERIAL PRIMARY KEY,
  country VARCHAR,
  city VARCHAR
);

CREATE TABLE survey_demographics (
  participant_id INT,
  location_id INT,
  FOREIGN KEY (participant_id) REFERENCES survey_participants(id),
  FOREIGN KEY (location_id) REFERENCES survey_locations(location_id)
);

CREATE TABLE demographics (
    participant_id UUID PRIMARY KEY,
    age INT,
    gender VARCHAR,
    location VARCHAR
);

CREATE TABLE age_groups (
    age_group_id UUID PRIMARY KEY,
    group_name VARCHAR,
    min_age INT,
    max_age INT
);

CREATE TABLE genders (
    gender_id UUID PRIMARY KEY,
    gender_name VARCHAR
);

CREATE TABLE locations (
    location_id UUID PRIMARY KEY,
    location_name VARCHAR,
    city VARCHAR,
    country VARCHAR
);

CREATE TABLE participant_demographics (
    id UUID PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    location VARCHAR(50)
);

CREATE TABLE location (
    location_id UUID PRIMARY KEY,
    city VARCHAR(50),
    country VARCHAR(50)
);

CREATE TABLE survey (
    survey_id UUID PRIMARY KEY,
    start_date DATE,
    end_date DATE
);

CREATE TABLE survey_participant (
    participant_id UUID PRIMARY KEY,
    survey_id UUID,
    participant_name VARCHAR(100)
);

CREATE TABLE gender (
    gender_id UUID PRIMARY KEY,
    type VARCHAR(10)
);
